import './App.css';
import { Route, BrowserRouter, Link } from "react-router-dom";
import Navbar from './Components/Navbar';
import Breakfast from './Components/Breakfast'




class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
        <React.Fragment>
          <Link to="/"></Link>

          <Route path="/" exact component={Navbar} />



        </React.Fragment>
      </BrowserRouter>
    );
  }
}











export default App;
